import React, { Component } from 'react';
import {default as Header} from './Header';
import {default as Streams} from './Streams';
import './App.css';

class App extends Component {
  render() {
    return (
    <div>
      <Header />
      <Streams />
    </div>
  );
  }
}

export default App;
